import React from "react";

const Date = () => {
    let newDate = new Date()
    let date = newDate.getDate();
    let month = newDate.getMonth() + 1;
    let year = newDate.getFullYear();
    const separator = ''
    return `${year}${seperator}${month < 10 ? `0${month}` : `${month}`}${seperator}${date} `
}
